<template>
    <div>
        <v-row v-if="loader" class="py-4">
            <v-col class="text-center d-flex flex-column justify-center align-center">
                <v-progress-circular color="primary" class="mb-3" indeterminate></v-progress-circular>
               Cargando resultados...
            </v-col>
        </v-row>
        <div v-else id="doc-pdf" ref="content">
            <v-row>
                <v-card-subtitle v-if="motionName"><h3><b>Moción: </b>{{ motionName }}</h3></v-card-subtitle>
            </v-row>
            <v-row>
                <v-col md="4">
                    <v-card class="text-center pa-2">
                        <div class="display-1 color-green">{{aFavor}}</div>
                        <div>votos a favor</div>
                    </v-card>
                </v-col>
                <v-col md="4">
                    <v-card class="text-center pa-2">
                        <div class="display-1 color-red">{{ enContra }}</div>
                        <div>votos en contra</div>
                    </v-card>
                </v-col>
                <v-col md="4">
                    <v-card class="text-center pa-2">
                        <div class="display-1">{{ enBlanco }}</div>
                        <div>votos en blanco</div>
                    </v-card>
                </v-col>
            </v-row>

            <DetailVote :nominal_razonada="nominal_razonada" :nominativa="nominativa" :ordinarias="ordinarias"/>

            <v-simple-table >
                <template v-slot:default>
                    <thead>
                    <tr>
                        <th class="text-left">Concejal</th>
                        <th class="text-left">Opción</th>
                        <th class="text-left">Tipo</th>
                    </tr>
                    </thead>
                    <tbody>
                    <tr v-for="item in votes" :key="item._id">
                        <td>{{ item.user[0].lastname }} {{item.user[0].name}}</td>
                        <td>{{ item.options }}</td>
                        <td>{{ item.type_poll }}</td>
                    </tr>
                    </tbody>
                </template>
            </v-simple-table>

            <div class="my-4">
                <h3 class="my-2">Resultado</h3>
                <p v-if="aFavor !== enContra">
                    PARA LA MOCIÓN <b>{{ motionName.toUpperCase() }}</b> SE TIENE LA MAYORÍA CON
                    <span v-if="aFavor > enContra">
                        <b>{{aFavor}} VOTO(S) A FAVOR</b>  y <b>{{ enBlanco }} EN BLANCO</b>
                        DANDO COMO RESULTADO UN TOTAL DE <b>{{ aFavor+enBlanco}} VOTOS</b>
                    </span>
                    <span v-if="aFavor < enContra">
                        <b>{{enContra}} VOTOS(s) EN CONTRA</b> y <b>{{ enBlanco }} EN BLANCO</b>
                        DANDO COMO RESULTADO UN TOTAL DE <b>{{ enContra+enBlanco}} VOTOS</b>
                    </span>
                </p>
                <p v-else>
                    LA VOTACIÓN ESTÁ EMPATADA
                </p>
            </div>

            <div class="text-center my-6">
                <v-btn @click="generateReport" color="primary" elevation="0">
                    <v-icon left>mdi-file-pdf</v-icon>
                    Descargar Reporte</v-btn>
            </div>
        </div>


    </div>
</template>

<script>
    import DetailVote from "./DetailVote";
    import pdfMake from "pdfmake/build/pdfmake";
    import pdfFonts from "pdfmake/build/vfs_fonts";
    pdfMake.vfs = pdfFonts.pdfMake.vfs;

    export default {
        name: 'ListVotes',
        components: {DetailVote},
        props: {
            motion: {
                type: String,
            },
            session: {
                type: String,
                default: ''
            },
            act: {
                type: Number,
            }
        },
        data: () => ({
            votes: [],
            motionName: '',
            loader: false,
            loaderCalc: false,
            aFavor: 0,
            enContra: 0,
            enBlanco: 0,
            ordinarias: {
                aFavor: {
                    count: 0,
                    users: []
                },
                enContra: {
                    count: 0,
                    users: []
                },
                enBlanco: {
                    count: 0,
                    users: []
                }
            },
            nominativa: {
                aFavor: {
                    count: 0,
                    users: []
                },
                enContra: {
                    count: 0,
                    users: []
                },
                enBlanco: {
                    count: 0,
                    users: []
                }
            },
            nominal_razonada: {
                aFavor: {
                    count: 0,
                    users: []
                },
                enContra: {
                    count: 0,
                    users: []
                },
                enBlanco: {
                    count: 0,
                    users: []
                }
            }
        }),
        mounted() {
            this.getVotes();
            this.getActNumber();
        },
        methods: {
            generateReport(){
                // date
                const date = this.$moment().format('DD [de] MMMM [de] YYYY');
                // table body
                let persons = [];
                persons.push([{text:'CONCEJAL', bold: true}, {text:'OPCIÓN', bold: true}, {text:'TIPO', bold: true}]);
                for (let i=0; i<this.votes.length; i++){
                    persons.push([
                        `${this.votes[i].user[0].lastname} ${this.votes[i].user[0].name}`,
                        `${this.votes[i].options}`,
                        `${this.votes[i].type_poll}`
                    ]);
                }


                let docDefinition = {
                    content: [
                        { // header
                            alignment: 'center',
                            columns: [
                                {
                                    image: 'data:image/png;base64,',

                                    height: 60,
                                    width: 80,
                                    style: 'center'
                                },
                                {
                                    text: '\nGOBIERNO AUTÓNOMO DESCENTRALIZADO\nMUNICIPAL DE MACHALA',
                                    fontSize: 15,
                                    bold: true
                                },
                                {
                                    image: 'data:image/png;base64,\n',
                                    height: 80,
                                    width: 80,
                                    style: 'center'
                                },
                            ]
                        },
                        ' ',
                        {
                            text: `ACTA No. ${this.getActNumber()}.-\n`,
                            bold: true
                        },
                        {
                            text: `\nSESIÓN ORDINARIA DEL I. CONSEJO DEL GAD MUNICIPAL DE MACHALA, DEL ${date.toUpperCase()}\n\n`,
                            bold: true
                        },
                        {
                            alignment: 'left',
                            columns: [
                                { text: 'SESIÓN.- ', bold: true, width: 55, },
                                { text: this.session.toUpperCase(), width: '*'},
                            ]
                        },
                        {
                            alignment: 'left',
                            columns: [
                                { text: 'MOCIÓN.- ', bold: true, width: 55, },
                                { text: `${this.motionName}\n\n`, width: '*'},
                            ]
                        },
                        {
                            columns: [
                                { width: '*', text: '' },
                                {
                                    width: 'auto',
                                    style: 'tbUsers',
                                    table: {
                                        widths: [280, 'auto', 'auto'],
                                        body: persons
                                    }
                                },
                                { width: '*', text: '' },
                            ]
                        },

                        {
                            text: [`\nRESULTADO.-  ${this.getResult()}`],
                            bold: true,
                            italics: true,
                            fontSize: 11,
                            opacity: 0.8,
                            style: 'justify'
                        },
                        {
                            text: "\nCertifica.-\n",
                            bold: true
                        },
                        `\n\n\n\n`,
                        {
                            text: 'Abg. Miguel Angel Lozano Espinoza'
                        },
                        {
                            text: 'SECRETARIO GENERAL DEL I. CONSEJO'
                        },
                        {
                            text: 'DEL GAD MUNICIPAL MACHALA'
                        }

                    ],
                    styles:{
                        center: {alignment: 'center'},
                        right: {alignment: 'right'},
                        left: {alignment: 'left'},
                        header: {
                            alignment: 'center',
                            bold: true
                        },
                        justify: {
                            alignment: 'justify'
                        },
                        tbUsers: {

                        }
                    }
                };
                const win = window.open('', '_blank');
                pdfMake.createPdf(docDefinition).open({}, win);

            },
            getVotes(){
                this.loader = true;
                this.$http.get(`/lista-voto-usuario-mocion/${this.motion}`).then(res => {
                    if(res.data && res.data.motion) {
                        this.votes = res.data.motion.vote;
                        this.motionName = res.data.motion.text;
                        this.countVotes();
                    }
                }).finally(() => {
                    this.loader = false;
                })
            },
            countVotes(){
                this.clearCounters();
                for(let i=0; i<this.votes.length; i++) {
                    const v = this.votes[i];

                    switch (v.options.toLowerCase()) {
                        case 'a favor':
                            this.aFavor++;
                            break;
                        case 'en contra':
                            this.enContra++;
                            break;
                        case 'en blanco':
                            this.enBlanco++;
                            break;
                    }

                    switch (v.type_poll.toUpperCase()) {
                        //ORDINARIA, NOMINATIVA, NOMINAL RAZONADA
                        case 'ORDINARIA':
                            //let op = v.options.toLowerCase();
                            if (v.options.toLowerCase() === 'a favor') {
                                this.ordinarias.aFavor.count++;
                                this.ordinarias.aFavor.users.push(v.user[0]);
                            }
                            if (v.options.toLowerCase() === 'en contra') {
                                this.ordinarias.enContra.count++;
                                this.ordinarias.enContra.users.push(v.user[0]);
                            }
                            if (v.options.toLowerCase() === 'en blanco') {
                                this.ordinarias.enBlanco.count++;
                                this.ordinarias.enBlanco.users.push(v.user[0]);
                            }
                            break;
                        case 'NOMINATIVA':
                            if (v.options.toLowerCase() === 'a favor') {
                                this.nominativa.aFavor.count++;
                                this.nominativa.aFavor.users.push(v.user[0]);
                            }
                            if (v.options.toLowerCase() === 'en contra') {
                                this.nominativa.enContra.count++;
                                this.nominativa.enContra.users.push(v.user[0]);
                            }
                            if (v.options.toLowerCase() === 'en blanco') {
                                this.nominativa.enBlanco.count++;
                                this.nominativa.enBlanco.users.push(v.user[0]);
                            }
                            break;
                        case 'NOMINAL RAZONADA':
                            if (v.options.toLowerCase() === 'a favor') {
                                this.nominal_razonada.aFavor.count++;
                                this.nominal_razonada.aFavor.users.push(v.user[0]);
                            }
                            if (v.options.toLowerCase() === 'en contra') {
                                this.nominal_razonada.enContra.count++;
                                this.nominal_razonada.enContra.users.push(v.user[0]);
                            }
                            if (v.options.toLowerCase() === 'en blanco') {
                                this.nominal_razonada.enBlanco.count++;
                                this.nominal_razonada.enBlanco.users.push(v.user[0]);
                            }
                            break;
                        default:

                            break;
                    }
                }
            },
            clearCounters() {
                this.aFavor= 0;
                this.enContra= 0;
                this.enBlanco= 0;
                this.ordinarias = {
                    aFavor: {
                        count: 0,
                            users: []
                    },
                    enContra: {
                        count: 0,
                            users: []
                    },
                    enBlanco: {
                        count: 0,
                            users: []
                    }
                }
                this.nominativa = {
                    aFavor: {
                        count: 0,
                            users: []
                    },
                    enContra: {
                        count: 0,
                            users: []
                    },
                    enBlanco: {
                        count: 0,
                            users: []
                    }
                }
                this.nominal_razonada = {
                    aFavor: {
                        count: 0,
                            users: []
                    },
                    enContra: {
                        count: 0,
                            users: []
                    },
                    enBlanco: {
                        count: 0,
                            users: []
                    }
                }
            },
            getResult(){
                let result = '';
                if(this.aFavor > this.enContra) {
                    result = `PARA LA MOCIÓN ${this.motionName.toUpperCase()} SE TIENE UNA MAYORÍA `;
                    result+=`CON ${this.aFavor} VOTOS A FAVOR Y ${this.enBlanco} EN BLANCO,`;
                    result+= ` DANDO COMO RESULTADO UN TOTAL DE ${this.aFavor+this.enBlanco} VOTOS A FAVOR Y ${this.enContra} EN CONTRA.`;
                } else if (this.aFavor < this.enContra) {
                    result = `PARA LA MOCIÓN ${this.motionName.toUpperCase()} SE TIENE UNA MAYORÍA`;
                    result+= `CON ${this.enContra} VOTOS EN CONTRA Y ${this.enBlanco} EN BLANCO, DANDO COMO RESULTADO UN TOTAL DE `;
                    result+= `${this.enContra + this.enBlanco} VOTOS EN CONTRA Y ${this.aFavor}  A FAVOR`;
                } else {
                    result = `LA VOTACIÓN ESTA EMPATÓ`;
                }
                return result;
            },
            getActNumber(){
                const year = this.$moment().format('Y');
                let ceros = "";
                for(let i=0; i<3-this.act.toString().length; i++) {
                    ceros+="0";
                }
                return `${ceros}${this.act}-${year}`;
            }
        },

    }
</script>

<style scoped>
    .color-green {
        color: green;
    }
    .color-red {
        color: red;
    }
</style>
